INSERT INTO `rudra_faq` (`id`, `question`, `question_dk`, `answer`, `answer_dk`, `status`, `is_deleted`, `created_at`, `updated_at`) VALUES
(1, 'How do I order', 'Hvordan bestiller jeg', 'You book a wash, using our website or using our app', 'Du booker en vask, ved at bruge vores hjemmeside eller ved at bruge vores app', '1', '0', '2022-07-21 07:50:16', '2022-07-22 05:53:27'),
(2, 'How do I pay?', 'Hvordan afregnes / Betaler jeg', ' If you are an employee of a company where we come to wash, you will receive an SMS after your car has been washed, with the price and a number to which the money can be transferred via MobilePay.\r\nIf you are a private customer, you pay when you book your wash through the app.\r\n', 'Er du medarbejder hos en virksomhed hvor vi kommer og vasker, vil du modtage en SMS efter din bil er blevet vasket, med prisen samt et nummer hvortil pengene kan overføres via MobilePay.\r\n Er du privat-kunde betaler du ved booking af din vask igennem app’en. ', '1', '0', '2022-07-21 08:04:01', '2022-07-22 05:49:26'),
(3, 'Where to park your car', 'Hvor skal bilen parkeres.', 'We need about half a meter of space all the way around the car. Whether it\'s parked outside or inside doesn\'t matter for the wash.', ' Vi har brug for cirka en halv meters plads hele vejen rundt om bilen. Om den så holder ude eller inde betyder ikke noget for vasken.', '1', '0', '2022-07-21 08:14:43', '2022-07-21 08:14:43'),
(4, 'What if I\'m prevented', ' Hvad hvis jeg bliver forhindret', 'Should you be prevented, your booking must be cancelled at least 24 hours in advance.', ' Skulle du blive forhindret, skal din booking aflyses senest 24 timer i forvejen.', '1', '0', '2022-07-21 08:39:19', '2022-07-21 08:39:19'),
(5, 'Can you wash in the rain?', 'Kan i vaske i regnvejr?', 'We wash cars in sun, rain and snow as long as conditions allow for our washers. Should it be impossible for our washers to carry out the wash, you will be contacted to arrange a possible new time.', 'Vi vasker biler i sol, regn og snevejr, så længe forholdene tillader det for vores vaskere. Skulle det være umuligt for vores vaskere at udføre vasken, vil du blive kontaktet for at aftale en eventuel ny tid.', '1', '0', '2022-07-21 08:42:35', '2022-07-21 08:42:35'),
(6, 'Can my car be too dirty?', 'Kan min bil være for beskidt', 'We have very few restrictions, but unfortunately it can happen that a car is too dirty either inside or out. If this is the case, you will be contacted by our car wash where you can agree on the next steps.', ' Vi har meget få begrænsninger, men desværre kan det ske at en bil enten indvendigt eller udvendigt er for beskidt. Er det tilfældet vil du blive kontaktet af vores vasker hvor i kan aftale det videre forløb.', '1', '0', '2022-07-21 08:50:12', '2022-07-21 08:50:12'),
(7, 'How to unlock the car', 'Hvordan skal bilen låses op', 'When our washers are ready to wash your car, you will receive a call to unlock the car.', 'Når vores vaskere er klar til at vaske din bil vil du modtage et opkald om at du gerne må låse bilen op.', '1', '0', '2022-07-21 08:51:52', '2022-07-21 08:51:52'),
(8, 'How long does a wash take?', 'Hvor lang tid tager en vask', 'A combi wash without optional extras takes approximately 60 minutes.', ' En kombi-vask uden tilvalg tager cirka 60 minutter.', '1', '0', '2022-07-21 08:55:25', '2022-07-21 08:55:25');
